package WhileLoop;

public class EnhanceForLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x[]={10,20,30,40,50};
		for(int z : x){
			System.out.print(z + ",");
		}
		String names[]= {"Pisal","Michael","Jonh","Henry"};
		for(String name : names){
			System.out.print(name + " ");
		}
	}

}
